### JavaScript

```javascript
"use strict";

const ceil = Math.ceil;

function f_gold(a, b) {
    const m = a.length;
    const n = b.length;
    const ans = ceil(n / m);
    const t = Array(ans).fill(a);
    for (let i = 0; i < 3; i++) {
        if (t.join('').includes(b)) {
            return ans;
        }
        ans++;
        t.push(a);
    }
    return -1;
}
```
